 #l = pca.fit(gt, [\"t\", \"X\", \"Y\"], [\"X\"], [\"Y\"])\n    #print(\"this is l :\", l, flush=True)\n\n    cpt = [pca.explained_variance_ ,   pca.singular_values_ ]\n    # Submit the task graph to the scheduler\n\n    #explained_variance , singular_values = client.persist(cpt)\n    #arrays.validate_contract()   \n    #explained_variance , singular_values = client.compute([explained_variance ,singular_values])\n    print(\"explained_variance ,singular_values\", cpt , flush=True )\n\nprint(\"Done in \", time.time() -t , \" secondes\")\n    \nos.remove('data.h5') \nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"data":{"bandwidth":{"__ndarray__":"MIKgMePctEFfehJ619bIQZYRrHzPr7VBJNqLCOnAvUHnvgxD8Xy/QXUfRZOyH01B1RCyByKLv0EfX0JnAsi7QTK1X5xkRMBBHQU55Bq+w0FNZJFxx8LGQbbuvgzibrtBRAffP9gOt0Hg2xtEC5S2QTKe6qHnu7lBMZpD+ndKukFgixy3l/O/QWZUY2+u97dBhd6lh2CgskFBuaqOgCS8QWyME+lLKcFByLPkUx+JtkFhuL31vjXMQb60WX3hb7pBpUlwhhtXzUHTJLepqpO2QS8aKhx8l7hBMjgj+7qftkEzEoL0Sl25QSxwby+iJsRBH6ZWojnCu0GnQAfc0/XAQUpc46zPqbNBnIP+PvOyqUH25KLKeydYQQ==","dtype":"float64","order":"little","shape":[35]},"bandwidth_text":["333.81 MiB","794.86 MiB","346.99 MiB","476.06 MiB","503.81 MiB","3.64 MiB","504.70 MiB","444.50 MiB","520.55 MiB","631.76 MiB","728.35 MiB","438.93 MiB","368.93 MiB","361.25 MiB","411.74 MiB","420.65 MiB","511.22 MiB","383.48 MiB","298.02 MiB","450.28 MiB","549.16 MiB","360.57 MiB","902.72 MiB","422.99 MiB","0.92 GiB","361.23 MiB","393.47 MiB","361.98 MiB","405.83 MiB","644.83 MiB","444.14 MiB","542.73 MiB","314.61 MiB","205.59 MiB","6.04 MiB"],"destination":["tcp://172.21.5.144:41367","tcp://172.21.5.144:41367","tcp://172.21.5.144:41367","tcp://172.21.5.144:41367","tcp://172.21.5.144:41367","tcp://172.21.5.85:36891","tcp://172.21.5.144:37191","tcp://172.21.5.55:45112","tcp://172.21.5.50:45487","tcp://172.21.5.144:41367","tcp://172.21.5.50:45487","tcp://172.21.5.50:45487","tcp://172.21.5.50:45487","tcp://172.21.5.85:41751","tcp://172.21.5.
